import React from 'react';
import s from './Dialogs.module.css';
import {NavLink} from "react-router-dom";

const DialogItem = (props) => {
    let path = "/dialogs/" + props.id;

    return (
        <div className={s.dialog}>
            <NavLink to={path}>{props.name}</NavLink>
        </div>
    )
}

const Message = (props) => {
    return (
        <div className={s.message}>{props.massage}</div>
    )
}


const Dialogs = (props) => {
    return (
        <div className={s.dialogs}>
            <div className={s.dialogItems}>
                <DialogItem name="Max" id="1"/>
                <DialogItem name="Angelika" id="2"/>
                <DialogItem name="Aneta" id="3"/>
                <DialogItem name="Zoja" id="4"/>
                <DialogItem name="Andjei" id="5"/>
                <DialogItem name="Marysia" id="6"/>
            </div>
            <div className={s.messages}>
                <Message massage="Hi"/>
                <Message massage="How is your day?"/>
                <Message massage="You"/>
                <Message massage="You"/>
                <Message massage="You"/>
            </div>
        </div>
    )
};

export default Dialogs;
